  false,\n\t\"url\": null,\n\t\"notes\": \"The goal of the cruise was to collect data
  on the abundance, distribution, stock structure, and habitat of cetaceans in the
  Papah?naumoku?kea Marine National Monument (PMNM) using 7 integrated operations.
  These operations included visual observations, passive acoustic monitoring, photo-identification,
  biopsy sampling, satellite tagging, small boat surveys, and oceanography (CTD, Chlorophyll,
  XBT, and surface samples).  A High-frequency Acoustic Recording Package (HARP) was
  recovered during the cruise.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
